# This file contains common pin mappings for the BIGTREETECH Manta M5P
# To use this config, the firmware should be compiled for the
# STM32G0B1 with a "8KiB bootloader" "8 MHz crystal"
# and "USB (on PA11/PA12)" or "CAN bus (on PD0/PD1)".

# See docs/Config_Reference.md for a description of parameters.
[include macro.cfg]
[include mainsail.cfg]
[include scanner.cfg]
[include tilt.cfg]



[bed_screws]
screw1: 50, 350
screw2: 50, 350
screw3: 350, 50
screw4: 50, 50
screw5: 350, 200
screw6: 50, 200

[screws_tilt_adjust]
screw1: 35, 65
screw1_name: front left screw
screw2: 365, 65
screw2_name: front right screw
screw3: 365, 200
screw3_name: mid right screw
screw4: 365, 350
screw4_name: rear right screw
screw5: 35, 350
screw5_name: rear left screw
screw6: 35, 200
screw6_name: mid left screw
horizontal_move_z: 10.0
speed: 50.0
screw_thread: CW-M4

[safe_z_home]
home_xy_position: 200, 200
# Example home_xy_position: 175,175 - This would be for a 350 * 350mm bed. 
z_hop: 10

[temperature_sensor BTT_Manta]
sensor_type: temperature_mcu
min_temp: 0
max_temp: 100

[temperature_sensor BTT_CB1]
sensor_type: temperature_host
min_temp: 0
max_temp: 100


[stepper_x]
step_pin: PC8
dir_pin: !PC9
enable_pin: !PA15
microsteps: 16
rotation_distance: 40
endstop_pin: tmc2209_stepper_x:virtual_endstop
homing_retract_dist: 0
#endstop_pin: ^PD3
position_endstop: 0
position_max: 410
homing_speed: 50

[tmc2209 stepper_x]
uart_pin: PD9
driver_SGTHRS: 128  # 255 is most sensitive value, 0 is least sensitive
run_current: 0.600
diag_pin: PD3

[stepper_y]
step_pin: PA10
dir_pin: !PA14
enable_pin: !PA13
microsteps: 16
rotation_distance: 40
#endstop_pin: ^PD2
position_endstop: 0
endstop_pin: tmc2209_stepper_y:virtual_endstop
homing_retract_dist: 0
position_max: 400
homing_speed: 50

[tmc2209 stepper_y]
uart_pin: PD8
run_current: 0.800
driver_SGTHRS: 100  # 255 is most sensitive value, 0 is least sensitive
diag_pin: PD2

[stepper_z]
step_pin: PC6
dir_pin: PC7
enable_pin: !PA9
microsteps: 16
rotation_distance: 8
#endstop_pin: ^PC3
#position_endstop: 0.0
endstop_pin: probe:z_virtual_endstop # uses cartographer as virtual endstop
homing_retract_dist: 0 
position_max: 450

[tmc2209 stepper_z]
uart_pin: PB10
run_current: 0.800
diag_pin: PC3

[stepper_z1]
step_pin: PB0
dir_pin: PB1
enable_pin: !PC4
microsteps: 16
rotation_distance: 8
#endstop_pin: ^PC2
endstop_pin: probe:z_virtual_endstop

[tmc2209 stepper_z1]
uart_pin: PA6
run_current: 0.800
diag_pin:

[extruder]
step_pin: PB12
dir_pin: !PB11
enable_pin: !PA8
microsteps: 16
gear_ratio: 50:17
rotation_distance: 23.5
nozzle_diameter: 0.400
filament_diameter: 1.750
heater_pin: PC5
sensor_type: EPCOS 100K B57560G104F
sensor_pin: PA1
#control: pid
#pid_Kp: 21.527
#pid_Ki: 1.063
#pid_Kd: 108.982
min_temp: 0
max_temp: 250

[tmc2209 extruder]
uart_pin: PB2
run_current: 0.600
diag_pin: PC2

#sensor_type:MAX31865
#sensor_pin: PA4
#spi_bus: spi1
#rtd_nominal_r: 100
#rtd_reference_r: 430
#rtd_num_of_wires: 2

#[filament_switch_sensor material_0]
#switch_pin: PC2

#[extruder1]
#step_pin: PB0
#dir_pin: PB1
#enable_pin: !PC4
#heater_pin: PA7
#sensor_pin: PA2
#...

[heater_bed]
heater_pin: PA5
sensor_type: Generic 3950
sensor_pin: PA0
#control: watermark
min_temp: 0
max_temp: 130

[fan]
pin: PA4
max_power: 0.4
shutdown_speed: 0

[heater_fan fan1]
pin: PA3
max_power: 0.8
shutdown_speed: 0

#[heater_fan SoC_fan]
#pin: CB1:gpio79
#pin: RPI:gpio26

[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32g0b1xx_hurakan-if00

[printer]
kinematics: cartesian
max_velocity: 300
max_accel: 3000
max_z_velocity: 5
max_z_accel: 100

